import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to the user profile (simulate clicking "Your Profile" link)
    // Try to find the first "Your Profile" link (since there are many, pick the first visible)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for profile page to load (wait for .profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract profile info
    const extractedData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return {};

      const img = profileHeader.querySelector('.profile-image');
      const fullName = profileHeader.querySelector('.profile-info h2')?.innerText || '';
      const username = profileHeader.querySelector('.username')?.innerText || '';
      const bio = profileHeader.querySelector('.bio')?.innerText || '';

      // Stats
      const stats = {};
      profileHeader.querySelectorAll('.stat').forEach(stat => {
        const label = stat.querySelector('.stat-label')?.innerText?.trim();
        const number = stat.querySelector('.stat-number')?.innerText?.trim();
        if (label && number) stats[label] = number;
      });

      return {
        fullName,
        username,
        bio,
        profileImage: img ? img.src : '',
        stats
      };
    });

    // Take screenshot of Jun's products section
    const junProductsSection = await page.waitForSelector('.profile-sections .section:nth-child(1)', { timeout: 5000 });
    await junProductsSection.scrollIntoViewIfNeeded();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_products.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_jun_products.png'));

    // Extract Jun's products
    const junProducts = await page.evaluate(() => {
      const section = document.querySelector('.profile-sections .section:nth-child(1) .products-grid');
      if (!section) return [];
      return Array.from(section.querySelectorAll('.product-card')).map(card => {
        const title = card.querySelector('.product-title')?.innerText || '';
        const price = card.querySelector('.product-price')?.innerText || '';
        const seller = card.querySelector('.seller-info')?.innerText || '';
        const image = card.querySelector('img')?.src || '';
        return { title, price, seller, image };
      });
    });

    // Take screenshot of Jun's reviews section
    const junReviewsSection = await page.waitForSelector('.profile-sections .section:nth-child(2)', { timeout: 5000 });
    await junReviewsSection.scrollIntoViewIfNeeded();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_jun_reviews.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_jun_reviews.png'));

    // Extract Jun's reviews
    const junReviews = await page.evaluate(() => {
      const section = document.querySelector('.profile-sections .section:nth-child(2) .reviews-list');
      if (!section) return [];
      return Array.from(section.querySelectorAll('.review-item')).map(item => {
        const productTitle = item.querySelector('.review-product-title')?.innerText || '';
        const reviewTitle = item.querySelector('.review-title')?.innerText || '';
        const reviewContent = item.querySelector('.review-content')?.innerText || '';
        const reviewDate = item.querySelector('.review-date')?.innerText || '';
        const rating = item.querySelector('.stars')?.innerText || '';
        return { productTitle, reviewTitle, reviewContent, reviewDate, rating };
      });
    });

    // Combine all extracted data
    extractedData.junProducts = junProducts;
    extractedData.junReviews = junReviews;

    return {
      success: true,
      action: "Harvested user profile information including profile details, Jun's products, and reviews",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
